import React from 'react'

export const EnfermedadPadre = () => {
    return (
        <div>
            <div class="form-floating">
                        <input type = "text" class="form-control" name = "enfermedad_padre" id="enfermedad_padre"/>
                        <label htmlFor= "enfermedad_padre" >Enfermedad que padece o padecio</label>

                    </div>
        </div>
    )
}
